import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Films from './components/Films';  // Assuming Films.js is in the same directory
import AboutFilm from './AboutFilm';  // Assuming AboutFilm.js is in the same directory

class App extends React.Component {
  render() {
    return (
      <Router>
        <Switch>
          <Route path="/films" exact component={Films} />
          <Route path="/about-film" component={AboutFilm} />
        </Switch>
      </Router>
    );
  }
}

export default App;
